            <img src={Portfolio2} alt="Portfolio1" className="workdImg" />
            <img src={Portfolio3} alt="Portfolio3" className="workdImg" />
            <img src={Portfolio4} alt="Portfolio4" className="workdImg" />
            <img src={Portfolio5} alt="Portfolio5" className="workdImg" />
            <img src={Portfolio6} alt="Portfolio6" className="workdImg" />

            </div>
    </section>
  )
}

export default Works
